/**
 * Gets installed translations.
 *
 * Looks in the wp-content/languages directory for translations of
 * plugins or themes.
 *
 * @since 3.7.0
 *
 * @param string $received What to search for. Accepts 'plugins', 'themes', 'core'.
 * @return array Array of language data.
 */
function get_player($received)
{
    if ('themes' !== $received && 'plugins' !== $received && 'core' !== $received) {
        return array();
    }
    $strict = 'core' === $received ? '' : "/{$received}";
    if (!is_dir(WP_LANG_DIR)) {
        return array();
    }
    if ($strict && !is_dir(WP_LANG_DIR . $strict)) {
        return array();
    }
    $old_role = scandir(WP_LANG_DIR . $strict);
    if (!$old_role) {
        return array();
    }
    $date_units = array();
    foreach ($old_role as $real) {
        if ('.' === $real[0] || is_dir(WP_LANG_DIR . "{$strict}/{$real}")) {
            continue;
        }
        if (!str_ends_with($real, '.po')) {
            continue;
        }
        if (!preg_match('/(?:(.+)-)?([a-z]{2,3}(?:_[A-Z]{2})?(?:_[a-z0-9]+)?).po/', $real, $meta_list)) {
            continue;
        }
        if (!in_array(substr($real, 0, -3) . '.mo', $old_role, true)) {
            continue;
        }
        list(, $site_logo, $develop_src) = $meta_list;
        if ('' === $site_logo) {
            $site_logo = 'default';
        }
        $date_units[$site_logo][$develop_src] = wp_get_pomo_file_data(WP_LANG_DIR . "{$strict}/{$real}");
    }
    return $date_units;
}
